  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116706 includes chemical,
  discrete sample, physical and profile data collected from KNORR in the Caribbean
  Sea, North Atlantic Ocean and South Atlantic Ocean from 1982-12-01 to 1983-02-18
  and retrieved during cruise TTO_TAS_Expeditions. These data include ALKALINITY,
  DELTA CARBON-14, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), RADIUM ISOTOPES, SALINITY,
  SILICATE, Tritium (Hydrogen isotope) and WATER TEMPERATURE. The instruments used
  to collect these data include CTD and bottle. These data were collected by Taro
  Takahashi and Stewart Sutherland of Columbia University; Lamont-Doherty Earth Observatory
  and C. Rooth of Unknown as part of the TTO_TAS_Expeditions data set.\",\n\t\"owner_org\":
